import React from 'react'
import { Table } from 'antd'

const Inventory = () => {

    // dummy data
    const dataSource = [
        {
            key: 1,
            "year": 2016,
            "make": "Yamaha",
            "model": "R6",
            "color": "red", // can literally be a color instead of text
            "CC": 600, //  should have cc next to value
            "miles": 12991,
            "price": 9000, // should have dollar signs next to them to prevent confusion
            "NADA": 8500, 
            "KBB": 8000,
        },
        {
            key: 2,
            "year": 2016,
            "make": "Yamaha",
            "model": "R6",
            "color": "red",
            "CC": 600, //  should have cc next to value
            "miles": 12991,
            "price": 9000, // should have dollar signs next to them to prevent confusion
            "NADA": 8500, 
            "KBB": 8000,
        },
        {
            key: 3,
            "year": 2016,
            "make": "Yamaha",
            "model": "R6",
            "color": "red",
            "CC": 600, //  should have cc next to value
            "miles": 12991,
            "price": 9000, // should have dollar signs next to them to prevent confusion
            "NADA": 8500, 
            "KBB": 8000,
        },
    ] 

    const columns = [
        {
            title: 'Year',
            dataIndex: 'year',
            key: 'year',
        },
        {
            title: 'Make',
            dataIndex: 'make',
            key: 'make',
        },
        {
            title: 'Model',
            dataIndex: 'model',
            key: 'model',
        },
        {
            title: 'Color',
            dataIndex: 'color',
            key: 'color',
        },
        {
            title: 'CC',
            dataIndex: 'CC',
            key: 'CC',
        },
        {
            title: 'Miles',
            dataIndex: 'miles',
            key: 'miles',
        },
        {
            title: 'Price',
            dataIndex: 'price',
            key: 'price',
        },
        {
            title: 'NADA',
            dataIndex: 'NADA',
            key: 'NADA',
        },
        {
            title: 'KBB',
            dataIndex: 'KBB',
            key: 'KBB',
        },
    ]

    // information such as sold, date listed, date sold, COGS, revenue, notes, customer, should be hidden. If user clicks icon show more, then a modal will appear with the info

    return (
        <div>
            <Table dataSource={dataSource} columns={columns} />
        </div>
    )
}

export default Inventory
